import React from 'react';
import Wizard from './Wizard';

class App extends React.Component{

    constructor(props){
        super(props);
        this.state = {
            forms:[]
        };
        this.props={
            a:"a",
            b:'b'
        }
    }

    render(){
        return(
            <div>
                <Wizard />
                </div>
        );
    }

}


export default App;
